window.bookSummaryJSON = "<p> </p> <p><b>The deadly game to test the worth of mankind continues.</b></p> <p>Armed with the knowledge of his previous failure, the Master Hunter is able to piece together fragments of information necessary to take advantage of opportunities once missed. However even as he grows stronger, the need for trustworthy allies becomes evident as Trolls continue to jeopardize the salvation of humanity by sacrificing their own teammates to monopolize all the rewards.</p> <p>As history seems to be destined to repeat itself, a small but potent beacon of hope emerges from the darkest, most unexpected of places.</p> <p><i>Translated by Oppatranslations.</i></p>"; 
